import React from 'react';
import { BrowserRouter as Router, Route, NavLink } from 'react-router-dom';
import ShowReelList from './components/ShowReelList';
import CreateShowReel from './components/ShowReelForm';

const App = () => {
  return (
    <Router>
      <div>
        <h1>Show Reel Application</h1>
        <nav>
          <ul>
            <li>
              <NavLink to="/show_reels">Show All Reels</NavLink>
            </li>
            <li>
              <NavLink to="/create_reel">Create Reel</NavLink>
            </li>
          </ul>
        </nav>
        <Route path="/show_reels" component={ShowReelList} />
        <Route path="/create_reel" component={CreateShowReel} />
      </div>
    </Router>
  );
};

export default App;
